import './Body.css'
import Header from './Header'

function Body({spotify}) {
	return (
		<div className='body'>
			<Header spotify={spotify} />
			<div className='body-info'>
				<img src='' alt />
				<div className='body-infoText'>
					<strong>PLAYLIST</strong>
					<h2></h2>
					<p></p>
				</div>
			</div>
		</div>
	);
}

export default Body;
